import {
	Box,
	Button,
	ButtonGroup,
	Flex,
	HStack,
	IconButton,
	Input,
	SkeletonText,
	Text,
} from '@chakra-ui/react'
import { FaLocationArrow, FaTimes } from 'react-icons/fa'
import React, { Component, useEffect } from 'react'
import axios from 'axios'

import {
	useJsApiLoader,
	GoogleMap,
	Marker,
	Autocomplete,
	DirectionsRenderer,
	InfoWindow
} from '@react-google-maps/api'
import { useRef, useState } from 'react'
import Geocode from "react-geocode";

Geocode.setApiKey("AIzaSyBlEzuWQx1HuSam1ZEqVCdlDnQip5AujIs");
Geocode.enableDebug();


function App() {
	const [caraddress, setcaraddress] = useState("Loading ...");
	const [flag, setflag] = useState(0);
	const [getflag, setgetflag] = useState(0);
	const [center2, setcenter2] = useState({});
	const [center, setcenter] = useState({ lat: 13.9492, lng: 83.2547 });
	const [carDetails, setcarDetails] = useState([]);


	useEffect(() => {
		if (flag == 0) {

			navigator.geolocation.getCurrentPosition(function (position) {
				console.log("Latitude is :", position.coords.latitude);
				console.log("Longitude is :", position.coords.longitude);
				setcenter({ lat: position.coords.latitude, lng: position.coords.longitude })
			});
			setflag(1)
		}

		if (getflag > 0) {

			setTimeout(() => {
				console.log("Teting ++++++++" + getflag)
				getTopicData()
				setgetflag(getflag + 1)


			}, 5000)

		}

	}, [flag, getflag])

	const { isLoaded } = useJsApiLoader({
		googleMapsApiKey: "AIzaSyBlEzuWQx1HuSam1ZEqVCdlDnQip5AujIs",
		libraries: ['places'],
	})

	const [map, setMap] = useState(/** @type google.maps.Map */(null))
	const [directionsResponse, setDirectionsResponse] = useState(null)
	const [topic_name, settopic_name] = useState('')
	const [car_alert, setcar_alert] = useState(0)

	/** @type React.MutableRefObject<HTMLInputElement> */
	const originRef = useRef()
	/** @type React.MutableRefObject<HTMLInputElement> */
	const destiantionRef = useRef()

	if (!isLoaded) {
		return <SkeletonText />
	}


	async function getTopicData() {

		const getStocksData = {
			url: 'http://localhost:5000/publish',
			method: 'POST',
			headers: {
				'Content-Type': 'application/json',
			},
			data: JSON.stringify({
				"topic": topic_name,
			})
		}
		axios(getStocksData)
			.then(response => {

				console.log("+++++++++++++++")
				console.log(response.data)
				console.log("+++++++++++++++")
				setcarDetails(response.data.data)
				try {


					if (response.data.data.speed >= response.data.threshold) {
						// alert("Correct" + response.data.data.speed)

						setcar_alert(1)
					}
					else {
						// alert("error" + response.data.data.speed)
						setcar_alert(0)

					}
				}

				catch {
					setcar_alert(0)

					// alert("catch" + response.data.data.speed)

				}

				let new_location = {
					"lat": response.data.data.lat,
					"lng": response.data.data.lon

				}
				setcenter(new_location)
				setcenter2(new_location)
				Geocode.fromLatLng(response.data.data.lat, response.data.data.lon).then(
					response => {
						const address = response.results[0].formatted_address

						console.log(address)
						setcaraddress(address)




					},
					error => {
						console.error(error);
					}
				);



			})
			.catch(function (e) {

				console.log(e.message)
				if (e.message === 'Network Error') {
					alert("No Internet Found. Please check your internet connection")
				}
				else {
					alert("Sorry, something went wrong. Please try again after sometime. If the issue still persists contact support.")
				}

			});




	}

	async function calculateRoute() {

		if (originRef.current.value === '' || destiantionRef.current.value === '' || topic_name === '') {
			alert("Please Enter Required Details!")
		}


		// eslint-disable-next-line no-undef
		const directionsService = new google.maps.DirectionsService()
		const results = await directionsService.route({
			origin: originRef.current.value,
			destination: destiantionRef.current.value,
			// eslint-disable-next-line no-undef
			travelMode: google.maps.TravelMode.DRIVING,
		})
		setDirectionsResponse(results)

		setflag(flag + 1)
		setgetflag(getflag + 1)

	}

	function clearRoute() {
		setDirectionsResponse(null)

		originRef.current.value = ''
		destiantionRef.current.value = ''
	}



	return (
		<Flex
			position='relative'
			flexDirection='column'
			alignItems='center'
			h='98vh'
		// w='100vw'
		>
			<Box position='absolute' left={0} top={0} h='100%' w='100%'>
				{/* Google Map Box */}
				<GoogleMap
					center={center}
					zoom={16}
					mapContainerStyle={{ width: '100%', height: '100%' }}
					options={{
						zoomControl: false,
						streetViewControl: false,
						mapTypeControl: false,
						fullscreenControl: false,
					}}
					onLoad={map => setMap(map)}
				>
					<Marker position={center} />

					<Marker position={center2}
								icon={{
									url: (require(car_alert == 0 ? './cargreen.png' : './carred.png')),
									scaledSize: { width: 60, height: 60 }
								}
								}

							>
								<InfoWindow position={center2}>

								<div>
								<span>{"Address: "+caraddress+
									", Azimuth - "+carDetails.azimuth+
									", DevId - "+carDetails.devId+
									", Satelites - "+carDetails.satelites+
									", SatelitesError - "+carDetails.satelitesError+
									", SoftVersion"+carDetails.softVersion+", Time - "+
									carDetails.time+
									", Speed - "+carDetails.speed}</span>								
									</div>
								</InfoWindow>


							</Marker>
							{/* {
						caraddress != "Loading ..." ?
						<>
							<Marker position={center2}
								icon={{
									url: (require(car_alert == 0 ? './cargreen.png' : './carred.png')),
									scaledSize: { width: 100, height: 100 }
								}
								}

							>
								<InfoWindow position={center2}>

								<div>
									<span>{"Address: "+caraddress+
									", Azimuth - "+carDetails.azimuth+
									", DevId - "+carDetails.devId+
									", Satelites - "+carDetails.satelites+
									", SatelitesError - "+carDetails.satelitesError+
									", SoftVersion"+carDetails.softVersion+", Time - "+
									carDetails.time+
									", Speed - "+carDetails.speed}</span>

									</div>
								</InfoWindow>


							</Marker> </>: null
					} */}

					{directionsResponse && (
						<DirectionsRenderer directions={directionsResponse} options={{
							polylineOptions: {
								strokeOpacity: 12,
								strokeColor: '#1641a6',
								strokeWeight: 8
							},

						}} />
					)}



				</GoogleMap>
			</Box>
			<Box
				p={2}
				borderRadius='lg'
				m={4}
				bgColor='#348feb'
				shadow='base'
				minW='container.md'
				zIndex='2'
				style={{ padding: 20, borderRadius: 20 }}
			>
				<HStack spacing={2} justifyContent='space-between'>
					<Box flexGrow={1}>
						<Autocomplete>
							<Input
								style={{ padding: 10, borderRadius: 8, backgroundColor: 'white', color: 'darkblue', width: 400 }}

								type='text' placeholder='Origin' ref={originRef} />
						</Autocomplete>
					</Box>
					<Box flexGrow={1} >
						<Autocomplete>
							<Input
								style={{ padding: 10, borderRadius: 8, backgroundColor: 'white', color: 'darkblue', width: 400 }}
								type='text'
								placeholder='Destination'
								ref={destiantionRef}
							/>
						</Autocomplete>
					</Box>

					<Box flexGrow={1} >
						<Input
							style={{ padding: 10, borderRadius: 8, backgroundColor: 'white', color: 'darkblue', width: 200 }}
							type='text'
							placeholder='Topic Name'
							value={topic_name}
							onChange={(e) => settopic_name(e.target.value)}
						/>
					</Box>

					<ButtonGroup>
						<Button colorScheme='pink' type='submit' onClick={calculateRoute} style={{ padding: 10, borderRadius: 8, backgroundColor: 'green', color: 'white' }}>
							SUBMIT
						</Button>

						<Button colorScheme='pink' type='submit' onClick={() => setcar_alert(0)} style={{ padding: 10, borderRadius: 8, backgroundColor: 'darkblue', color: 'white' }}>
							RESET
						</Button>
						<Button colorScheme='pink' type='submit'
							onClick={() => window.location.reload()}
							style={{ padding: 10, borderRadius: 8, backgroundColor: 'red', color: 'white' }}>
							CLEAR ALL
						</Button>


					</ButtonGroup>
				</HStack>

			</Box>
		</Flex>
	)
}

export default App
